package ufc.ck017.mmjc.activationRecords.frame;import ufc.ck017.mmjc.activationRecords.temp.Temp;import ufc.ck017.mmjc.translate.tree.Exp;import ufc.ck017.mmjc.translate.tree.TEMP;public class InReg extends Access {	Temp temp;	Exp access;		InReg(Temp t) {		temp = t;		access = new TEMP(temp);	}	public Exp exp(Exp fp) {		return access;	}		public Exp exp() {		return access;	}	public String toString() {		return temp.toString();	}}